import './App.css';
import Landing from './landing/Landing'
import { BrowserRouter, Route, Routes } from "react-router"

import Testt from './landing/testt'


function App() {
  return (
  <BrowserRouter>
    <Routes>
      <Route path="/" element={<Landing />} />
      <Route path="/route1" element={<Testt />} />
    </Routes>
  </BrowserRouter>
    // <Landing />
  );
}

export default App;
